import 'bootstrap/dist/css/bootstrap.min.css';
import {Component} from "react/cjs/react.production.min";
import React from 'react'
import {
Label, Modal, ModalHeader, ModalBody, Form, FormGroup,NavLink, Input, ModalFooter, Button
} from 'reactstrap'

class CreateNewAccount extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: "",
            password: "",
            email: "",
            last: "",
            first: "",
            modal: false
        }
    }

    toggle = () => {
        this.setState({modal: !this.state.modal});
    }
    createUser = () => {

    }

    submitForm = () => {
        this.createUser()
        this.toggle()
    }
    render() {
        return (
            <div>
                <NavLink onClick={this.toggle}>Create New Account</NavLink>
                <Modal isOpen={this.state.modal} toggle={this.toggle}>
                    <ModalHeader toggle={this.toggle}>Create New Account</ModalHeader>
                    <ModalBody className={"m-4"}>
                        <Form>
                            <FormGroup>
                                <Label>Username</Label>
                                <Input type="text" id="enteredUsername" value={this.state.username}/>
                            </FormGroup>
                            <FormGroup>
                                <Label>Password</Label>
                                <Input type="text" id="enteredPassword" value={this.state.password}/>
                            </FormGroup>
                            <FormGroup>
                                <Label>Email</Label>
                                <Input type="text" id="enteredEmail" value={this.state.email}/>
                            </FormGroup>
                            <FormGroup>
                                <Label>First Name</Label>
                                <Input type="text" id="enteredFirst" value={this.state.first}/>
                            </FormGroup>
                            <FormGroup>
                                <Label>Last Name</Label>
                                <Input type="text" id="enteredLast" value={this.state.last}/>
                            </FormGroup>
                        </Form>
                    </ModalBody>
                    <ModalFooter>
                        <Button color="primary" onClick={this.submitForm}>Create Account</Button>
                    </ModalFooter>
                </Modal>
            </div>
        )
    }

}
export default CreateNewAccount
